  return (
    <div className='footer'>
      
      
        <div className='left-footer'>

        </div>
        <div className='right-footer'>
            <ul>
              <li>
                <FaHome size={20} style={{color:"#fff",marginRight:"2rem"}}/>
              </li>
              <li>
              <FaHome size={20} style={{color:"#fff",marginRight:"2rem"}}/>
              </li>
            </ul>
        </div>
      
    </div>
  )
}

export default Footer;
